     */
    public function getAllPY($chinese, $delimiter = '', $length = 0,$charset='utf-8') {
        if($charset != 'gb2312') $chinese = $this->_U2_Utf8_Gb($chinese);
       $py = $this->zh_to_pys($chinese, $delimiter);
       if($length) {
           $py = substr($py, 0, $length);
       }
       return $py;
    }
    
    /**
